/*
Blocks:
A -> ofBlock...(BW_GlasBlocks, 15, ...); // tier glass
B -> ofBlock...(componentAssemblyLineCasing, 0, ...); // tier component block
C -> ofBlock...(gt.blockcasings2, 9, ...);
D -> ofBlock...(gt.blockcasings9, 1, ...);
E -> ofBlock...(gt.blockcasingsBA0, 12, ...); // energy hatch
F -> ofBlock...(gt.blockcasingsTT, 7, ...);
G -> ofBlock...(gt.blockcasingsTT, 9, ...);
H -> ofBlock...(gt.blockcasingsTT, 10, ...);
I -> ofBlock...(gt.blockcasingsTT, 12, ...);
J -> ofBlock...(gt.blockcasingsTT, 13, ...);
K -> ofBlock...(tile.quantumGlass, 0, ...);
L -> ofBlock...(gt.blockcasingsTT, 12, ...); // io
 */
    // spotless:on
    @Override
    public IStructureDefinition<TST_IndistinctTentacle> getStructureDefinition() {
        if (STRUCTURE_DEFINITION == null) {
            STRUCTURE_DEFINITION = StructureDefinition.<TST_IndistinctTentacle>builder()
                .addShape(STRUCTURE_PIECE_MAIN, transpose(shapeMain))
                .addElement(
                    'A',
                    withChannel(
                        "glass",
                        BorosilicateGlass.ofBoroGlass(
                            (byte) 0,
                            (byte) 1,
                            Byte.MAX_VALUE,
                            (te, t) -> te.glassTier = t,
                            te -> te.glassTier)))
                .addElement(
                    'B',
                    withChannel(
                        "component",
                        ofBlocksTiered(
                            (block, meta) -> block == Loaders.componentAssemblylineCasing ? meta : -1,
                            IntStream.range(0, 14)
                                .mapToObj(i -> Pair.of(Loaders.componentAssemblylineCasing, i))
                                .collect(Collectors.toList()),
                            -2,
                            (t, meta) -> t.tierComponentCasing = meta,
                            t -> t.tierComponentCasing)))
                .addElement('C', ofBlock(GregTechAPI.sBlockCasings2, 9))
                .addElement('D', ofBlock(GregTechAPI.sBlockCasings9, 1))
                .addElement(
                    'E',
                    HatchElementBuilder.<TST_IndistinctTentacle>builder()
                        .atLeast(Energy.or(ExoticEnergy))
                        .adder(TST_IndistinctTentacle::addEnergyHatchOrExoticEnergyHatchToMachineList)
                        .dot(1)
                        .casingIndex(texturePage << 7)
                        .buildAndChain(sBlockCasingsBA0, 12))
                .addElement('F', ofBlock(sBlockCasingsTT, 7))
                .addElement('G', ofBlock(sBlockCasingsTT, 9))
                .addElement('H', ofBlock(sBlockCasingsTT, 10))
                .addElement('I', ofBlock(sBlockCasingsTT, 12))
                .addElement('J', ofBlock(sBlockCasingsTT, 13))
                .addElement('K', ofChain(ofBlock(BlockQuantumGlass.INSTANCE, 0), ofBlock(sBlockCasingsTT, 13)))
                .addElement(
                    'L',
                    HatchElementBuilder.<TST_IndistinctTentacle>builder()
                        .atLeast(InputBus, InputHatch, OutputBus)
                        .adder(TST_IndistinctTentacle::addToMachineList)
                        .dot(2)
                        .casingIndex(1024 + 12)
                        .buildAndChain(sBlockCasingsTT, 12))
                .addElement('M', ofBlock(sBlockCasingsTT, 14))
                .build();
        }
        return STRUCTURE_DEFINITION;
    }

